import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to be dynamically rendered by JavaScript
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Take a screenshot after products are visible
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_products_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_products_visible.png'));

    // Use a locator to find all elements with the class 'product-price'
    const priceLocators = page.locator('.product-price');

    // Extract all text contents from the located elements
    const allPriceTexts = await priceLocators.allTextContents();

    // Clean the extracted text to get just the primary price value
    const prices = allPriceTexts.map(priceText => {
      // Handles cases like "$59.50 $79.99" by taking the first part
      return priceText.split(' ')[0].trim();
    });

    return {
      success: true,
      action: "Successfully extracted all product prices from the page.",
      extractedData: {
        productPrices: prices,
        count: prices.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
